export class Anime{
  public id: number;
  public nome: string;
  public ano: number;
  public quantidadeDeTemporada: number;
  public img: string;

  constructor(id: number, nome: string, ano: number, quantidadeDeTemporada: number, img){
    this.id = id;
    this.nome = nome;
    this.ano = ano;
    this.quantidadeDeTemporada = quantidadeDeTemporada;
  }


}
